*
 * 设置下载app的进度监听器
 *
 * 支持平台：书旗Android
 *
 * @return {Promise.<void>}
 *
 * @example
 * const params = [
 * {
 *  packageName: 'xx', // 必填。包名
 *  downloadUrl: '', // 必填。下载地址
 * },
 * {
 *  packageName: 'xx', // 必填。包名
 *  downloadUrl: '', // 必填。下载地址
 * },
 * ];
 * libSQ.exec('call-register-app-download-listener', {
 *   params,
 * }).then((info) => {
 *   alert(`[call-register-app-download-listener][then] ${JSON.stringify(info, null, 2)}`);
 * }).catch((err) => {
 *   alert(`[call-register-app-download-listener][error] ${JSON.stringify(err, null, 2)}`);
 * });

